classifyToken :: Token -> Int
classifyToken aToken =
   case aToken of
      IdentifierToken {}   -> divide
      NullToken {}         -> divide
      TrueToken {}         -> divide
      FalseToken {}        -> divide
      ThisToken {}         -> divide
      OctalToken {}        -> divide
      DecimalToken {}      -> divide
      HexIntegerToken {}   -> divide
      StringToken {}       -> divide
      RightCurlyToken {}   -> divide
      RightParenToken {}   -> divide
      RightBracketToken {} -> divide
      _other               -> reg


