--lexToken :: Alex Token
lexToken = do
  inp <- alexGetInput
  lt  <- getLastToken
  case lt of
    TailToken {} -> alexEOF
    _other ->
      case alexScan inp (classifyToken lt) of
        AlexEOF        -> do
          token <- tailToken
          setLastToken token
          return token
        AlexError inp'@(pos,_,_,_) -> alexError ("lexical error @ line " ++ show (getLineNum(pos)) ++
                                                 " and column " ++ show (getColumnNum(pos)))
        AlexSkip inp' _len -> do
          alexSetInput inp'
          lexToken
        AlexToken inp' len action -> do
          alexSetInput inp'
          -- token <- action (ignorePendingBytes inp) len
          token <- action inp len
          setLastToken token
          return token


