lexCont cont = do
   lexLoop
   where
   -- lexLoop :: P a
   lexLoop = do
      tok <- lexToken
      case tok of
         CommentToken {} -> do
            addComment tok
            lexLoop
         WsToken {} -> do
            addComment tok
            lexLoop
         _other -> do
            cs <- getComment
            let tok' = tok{ token_comment=(toCommentAnnotation cs) }
            setComment []
            cont tok'

toCommentAnnotation []    = [NoComment]
