toCommentAnnotation xs =  reverse $ map go xs
  where
    go tok@(CommentToken {}) = (CommentA (token_span tok) (token_literal tok))
    go tok@(WsToken      {}) = (WhiteSpace (token_span tok) (token_literal tok))

